"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#H86792383\">",
"      PATHOGENESIS OF THE REFEEDING SYNDROME",
"     </a>",
"    </li>",
