var title_f30_16_30988="WHO emergency contraception";
var content_f30_16_30988=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F79761&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F79761&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Emergency contraceptive pills: Medical eligibility criteria for contraceptive use",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Condition",
"      </td>",
"      <td class=\"subtitle1\">",
"       Category",
"      </td>",
"      <td class=\"subtitle1\">",
"       Clarifications/evidence",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Pregnancy",
"      </td>",
"      <td>",
"       NA",
"      </td>",
"      <td>",
"       Clarification: Although this method is not indicated for a woman with a known or suspected pregnancy, there is no known harm to the woman, the course of her pregnancy, or the fetus if ECPs are accidentally used.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Breastfeeding",
"      </td>",
"      <td>",
"       1",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       History of ectopic pregnancy",
"      </td>",
"      <td>",
"       1",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       History of severe cardiovascular complications* (ischaemic heart disease, cerebrovascular attack, or other thromboembolic conditions)",
"      </td>",
"      <td>",
"       2",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Angina pectoris*",
"      </td>",
"      <td>",
"       2",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Migraine*",
"      </td>",
"      <td>",
"       2",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Severe liver disease (including jaundice)*",
"      </td>",
"      <td>",
"       2",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Repeated ECP use",
"      </td>",
"      <td>",
"       1",
"      </td>",
"      <td>",
"       Clarification: Recurrent ECP use is an indication that the woman requires further counselling on other contraceptive options. Frequently repeated ECP use may be harmful for women with conditions classified as 2, 3 or 4 for COC, CIC or POC use.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Rape&bull;",
"      </td>",
"      <td>",
"       1",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Emergency contraception pills (ECPs) (including levonorgestrel contraceptive pills and combined oral contraceptive pills). ECPs do not protect against STI/HIV. If there is risk of STI/HIV (including during pregnancy or postpartum), the correct and consistent use of condoms is recommended, either alone or with another contraceptive method. Male latex condoms are proven to protect against STI/HIV.",
"    <br>",
"     NOTE: In 2010, the Centers for Disease Control (CDC) updated this list by adding history of bariatric surgery, rheumatoid arthritis, inflammatory bowel disease, and solid organ transplantation as medical conditions classified as Category 1 for use of emergency contraception pills.",
"     <div class=\"footnotes\">",
"      1: A condition for which there is no restriction for the use of the contraceptive method.",
"      <br>",
"       2: A condition where the advantages of using the method generally outweigh the theoretical or proven risks.",
"       <br>",
"        * The duration of use of ECPs is less than that of regular use of COCs or POPs and thus would be expected to have less clinical impact.",
"        <br>",
"         &bull; There are no restrictions for use of ECPs in cases of rape.",
"        </br>",
"       </br>",
"      </br>",
"     </div>",
"     <div class=\"reference\">",
"      Reproduced with permission from: World Health Organization. Medical eligibility criteria for contraceptive use - 3rd edition. Available at: file://www.who.int/reproductive-health/publications/mec/summary.html. Copyright &copy;2006 World Health Organization.",
"     </div>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
